import React from 'react';
import  {BrowserRouter as NavLink} from 'react-router-dom';


function Contact() {
  return (
    <div>
     <h2>Dashboard</h2>
     <NavLink to='/'><h1><h2>Home</h2></h1></NavLink>
    </div>
  )
}

export default Contact
